import React from "react";
import Button from "../../UI/Button";
import "./style.scss";
import Filter from "./Filter";

export default function Header() {
	return (
		<div className="main-header">
			<Button id="Add" title="Add" className="btn btnAdd" />
			<input placeholder="search" className="input-search" maxLength={35} pattern="" />
			<div id="Filter" title="Filter">
				<label className="btn btnFilter" htmlFor="filter">
					Filter
				</label>
				<input type="checkbox" name="filter" id="filter" />
				<Filter />
			</div>
		</div>
	);
}
